import { __decorate } from "tslib";
import { Component } from '@angular/core';
let AllTaskComponent = class AllTaskComponent {
    constructor(cheetaUserService) {
        this.cheetaUserService = cheetaUserService;
        this.bigTask = [];
        this.smallTask = [];
        this.membersArr = [];
        this.members = '';
    }
    async ngOnInit() {
        let resMembers = await this.cheetaUserService.getUsersList();
        this.membersArr = resMembers;
        console.log(this.membersArr);
    }
};
AllTaskComponent = __decorate([
    Component({
        selector: 'app-all-task',
        templateUrl: './all-task.component.html',
        styleUrls: ['./all-task.component.scss']
    })
], AllTaskComponent);
export { AllTaskComponent };
